import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import TrashReportBoard from './components/TrashReportBoard';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/complain" element={<TrashReportBoard />} />
        <Route path="/" element={<Navigate to="/complain" replace />} /> {/* 리디렉션 */}
        {/* 또는: <Route path="*" element={<div>404 Not Found</div>} /> */}
      </Routes>
    </Router>
  );
}

export default App;
